import React, { useState } from 'react';

const TestePage = () => {

  const [count, setCount] = useState(0)
  const [calculation, setCalculation] = useState(0)


  return (
    <>
      <p>Count: {count}</p>
      <button onClick={() => setCount((c) => c + 1)}>+</button>
      <p>Calculation: {calculation}</p>
    </>
  );
};

export default TestePage;
